import React from 'react'
import { useContext } from './HookUseContext';

function ComponentF() {
    return (
        <useContext.Consumer>
            {(user) => (
                <div>
                    welcome {user}
                </div>
            )}
        </useContext.Consumer>
    )
}

export default ComponentF;
